import React from 'react'
import obj from './Data.js'

const Watches = () => {
  return (
    <div>
      <div>
        <h1>
            {obj.map(a=>{
              return  `<img src=${a.img}</img>`
            })}
        </h1>
      </div>
    </div>
  )
}

export default Watches
